import React from 'react'



export default function Signup() {
    return (
        <div>
            <p style={{cdisplay: 'flex', justifyContent: 'flex-end'}}>Not a member? <a href="#" style={{color: '#EA4C89'}}>Sign Up Now</a> </p>
            <section className="container">
                <h3 style={{fontWeight: '600', color: '#333333', marginTop: '100px'}}>Sign Up To Panoko</h3>
            </section>
        </div>
    )
}
